import React from 'react';
import './Styles.css';

const Home = () => {
  return (
    <div className="app">
      <div className="sidebar">
        <h2>Connections</h2>
        <div className="connections">
          <a href="https://www.linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer">
            <img src="linkedin-logo.png" alt="LinkedIn Logo" className="scalable-logo" />
          </a>
          <p>Email 1: <a href="mailto:email1@example.com">email1@example.com</a></p>
          <p>Email 2: <a href="mailto:email2@example.com">email2@example.com</a></p>
        </div>
      </div>

      <div className="main-content">
        <div className="tabs">
          <button className="tab-button active">Projects</button>
        </div>
        <div className="tab-content">
          <div className="tab-panel active">
            <h1>Projects</h1>
            <p>List your projects here.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
